import{_ as e,c as o,o as a,av as l}from"./chunks/framework.B1bPfM8U.js";const f=JSON.parse('{"title":"科学上网-Cloudflare-Pages","description":"","frontmatter":{},"headers":[],"relativePath":"Docs/Linux/Wall/科学上网-Cloudflare-Pages.md","filePath":"Docs/Linux/Wall/科学上网-Cloudflare-Pages.md","lastUpdated":1718243983000}'),d={name:"Docs/Linux/Wall/科学上网-Cloudflare-Pages.md"},r=l('<h1 id="科学上网-cloudflare-pages" tabindex="-1">科学上网-Cloudflare-Pages <a class="header-anchor" href="#科学上网-cloudflare-pages" aria-label="Permalink to &quot;科学上网-Cloudflare-Pages&quot;">​</a></h1><h2 id="部署-cloudflare-pages" tabindex="-1">部署 Cloudflare Pages <a class="header-anchor" href="#部署-cloudflare-pages" aria-label="Permalink to &quot;部署 Cloudflare Pages&quot;">​</a></h2><ol><li><p>下载 <a href="https://raw.githubusercontent.com/cmliu/edgetunnel/main/worker.zip" target="_blank" rel="noreferrer">worker.zip</a> 已备份在比特球网盘</p></li><li><p>在 <code>Cloudflare Pages</code> 控制台中选择 上传资产后，为你的项目取名后点击 创建项目，然后上传你下载好的 <code>worker.zip</code> 文件后点击 部署站点</p></li><li><p>部署完成后点击 继续处理站点 后，选择 <code>设置</code> &gt; <code>环境变量</code> &gt; <code>制作为生产环境定义变量</code> &gt; <code>添加变量</code>。 变量名称填写 <code>UUID</code> ，值则为你的 <code>UUID</code>，后点击 保存即可。 <a href="https://1024tools.com/uuid/" target="_blank" rel="noreferrer">在线生成UUID</a></p></li><li><p>返回 <code>部署</code> 选项卡，在右下角点击 <code>创建新部署</code> 后，重新上传 <code>worker.zip</code> 文件后点击 <code>保存并部署</code> 即可。</p></li></ol><h2 id="访问订阅内容" tabindex="-1">访问订阅内容 <a class="header-anchor" href="#访问订阅内容" aria-label="Permalink to &quot;访问订阅内容&quot;">​</a></h2><ol><li>访问 <code>https://[YOUR-PAGES-URL]/[YOUR-UUID]</code> 即可获取订阅内容</li></ol><div class="warning custom-block"><p class="custom-block-title">注意</p><p>直接使用默认网页地址生成的 <code>v2ray</code> 链接，会被屏蔽，无法正常使用，建议参考下方教程配置 <code>自定义域</code> 访问</p></div><h2 id="配置自定义域" tabindex="-1">配置自定义域 <a class="header-anchor" href="#配置自定义域" aria-label="Permalink to &quot;配置自定义域&quot;">​</a></h2><ol><li><p>在 <code>Pages</code> 控制台的 <code>自定义域</code> 选项卡，下方点击 <code>设置自定义域</code>。</p></li><li><p>填入你的自定义二级域名，注意不要使用你的根域名，例如：我的主域名是 <code>muyi086.top</code>, 添加一个已经解析过的二级域名 <code>v2ray.muyi086.top</code></p></li><li><p>再次访问 <code>https://[自定义二级域名]/[YOUR-UUID]</code> 即可获取订阅内容，此时这个 <code>v2ray</code> 链接是可以科学上网的</p></li></ol><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-label="Permalink to &quot;参考&quot;">​</a></h2><ol><li><a href="https://github.com/cmliu/edgetunnel" target="_blank" rel="noreferrer">edgetunnel</a></li></ol>',10),c=[r];function t(i,s,n,u,p,h){return a(),o("div",null,c)}const g=e(d,[["render",t]]);export{f as __pageData,g as default};
